const { GET_PLACES } = require('../types')

const iState = {
  posts: []
}

const PlaceReducer = (state = iState, action) => {
  switch (action.type) {
    case GET_PLACES:
      return { ...state, places: action.payload }
    default:
      return { ...state }
  }
}

export default PlaceReducer
